import raw from './assets/LifeSimulation01.xml';



class map
{

      constructor()
      {
            this.map_height = 0;
            this.map_width = 0;
            this.getstuff();
      }

      get width() {
            return this.map_width
      }

      get height() {
            return this.map_height
      }

      
      getstuff()
      {
            fetch(raw)
            .then(r=>r.text())
            .then(text=>{
                  let lines = text.split('\n');
                  this.map_width = parseInt(lines[3]);
                  this.map_height = parseInt(lines[6]);
            })
      }

}
 
export default map;
